import PropTypes from "prop-types";
import link from "./index.css";

export function Link({ children, href, targetBlank }) {
  return (
    <>
      <a
        className={link.link}
        href={href}
        target={targetBlank ? "_blank" : "_self"}
      >
        {children}
      </a>
    </>
  );
}

Link.propTypes = {
  href: PropTypes.string,
  targetBlank: PropTypes.bool,
};
